import React, { useState, useEffect } from "react";
import { fetchImages } from "./services/unsplashApi";
import Modal from "react-modal";
import { ThreeDots } from "react-loader-spinner";

Modal.setAppElement("#root"); // Для доступності

function App() {
  const [query, setQuery] = useState(""); // Пошуковий запит
  const [images, setImages] = useState([]); // Масив зображень
  const [page, setPage] = useState(1); // Сторінка пагінації
  const [loading, setLoading] = useState(false); // Статус завантаження
  const [modalIsOpen, setModalIsOpen] = useState(false); // Статус модального вікна
  const [modalImage, setModalImage] = useState(""); // URL зображення для модального вікна

  // Пошук зображень
  const searchImages = async (newQuery) => {
    setLoading(true);
    setPage(1); // Скидаємо сторінку до 1
    const newImages = await fetchImages(newQuery, 1);
    setImages(newImages);
    setQuery(newQuery);
    setLoading(false);
  };

  // Завантаження більше зображень
  const loadMoreImages = async () => {
    setLoading(true);
    const nextPage = page + 1;
    const moreImages = await fetchImages(query, nextPage);
    setImages((prevImages) => [...prevImages, ...moreImages]);
    setPage(nextPage);
    setLoading(false);
  };

  // Нескінченний скрол
  useEffect(() => {
    const handleScroll = () => {
      if (
        window.innerHeight + document.documentElement.scrollTop !==
          document.documentElement.offsetHeight ||
        loading
      )
        return;

      loadMoreImages();
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, [loading, query, page]);

  // Відкриття модального вікна
  const openModal = (imageURL) => {
    setModalImage(imageURL);
    setModalIsOpen(true);
  };

  const closeModal = () => setModalIsOpen(false);

  return (
    <div>
      <h1 style={{ textAlign: "center" }}>Image Search App</h1>
      {/* Пошукова форма */}
      <div style={{ textAlign: "center", marginBottom: "20px" }}>
        <input
          type="text"
          placeholder="Search images..."
          onKeyPress={(e) => e.key === "Enter" && searchImages(e.target.value)}
          style={{ padding: "10px", width: "300px", marginRight: "10px" }}
        />
        <button
          onClick={() => searchImages(query)}
          style={{ padding: "10px 20px" }}
        >
          Search
        </button>
      </div>

      {/* Галерея зображень */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fill, minmax(250px, 1fr))",
          gap: "20px",
          padding: "20px",
        }}
      >
        {images.map((image) => (
          <img
            key={image.id}
            src={image.urls.small}
            alt={image.alt_description}
            onClick={() => openModal(image.urls.regular)}
            style={{
              width: "100%",
              height: "200px",
              objectFit: "cover",
              cursor: "pointer",
            }}
          />
        ))}
      </div>

      {/* Спінер завантаження */}
      {loading && (
        <div style={{ textAlign: "center", marginTop: "20px" }}>
          <ThreeDots color="#00BFFF" height={80} width={80} />
        </div>
      )}

      {/* Повідомлення, якщо немає зображень */}
      {!loading && images.length === 0 && query && (
        <p style={{ textAlign: "center" }}>No images found. Try another query.</p>
      )}

      {/* Модальне вікно */}
      <Modal
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        style={{
          overlay: { backgroundColor: "rgba(0, 0, 0, 0.8)" },
          content: {
            top: "50%",
            left: "50%",
            right: "auto",
            bottom: "auto",
            marginRight: "-50%",
            transform: "translate(-50%, -50%)",
            background: "transparent",
            border: "none",
            padding: "0",
          },
        }}
      >
        <img src={modalImage} alt="Large preview" style={{ width: "100%" }} />
        <button
          onClick={closeModal}
          style={{
            position: "absolute",
            top: "10px",
            right: "10px",
            padding: "10px 20px",
            fontSize: "16px",
            backgroundColor: "#fff",
            border: "none",
            cursor: "pointer",
          }}
        >
          Close
        </button>
      </Modal>
    </div>
  );
}

export default App;
